import Vue from 'vue'
import Router from 'vue-router'

/* User Views */
import Dashboard from './components/Dashboard.vue'
import UserList from './components/UserList.vue'
import UserProfile from './components/UserProfile.vue'
import Feedback from './components/Feedback.vue'
import LocationList from './components/LocationList.vue'
import LinkLocation from './components/LinkLocation.vue'
import Customers from './components/Customers.vue'
import CustomerList from './components/CustomerList.vue'
import MobileCustomerAdd from './components/MobileCustomerAdd.vue'
import UploadList from './components/UploadList.vue'
import Automations from './components/Automations.vue'
import CampaignList from './components/CampaignList.vue'
import ReviewRequestList from './components/ReviewRequestList.vue'
import SurveyList from './components/SurveyList.vue'
import LoyaltyList from './components/LoyaltyList.vue'
import AppointmentsList from './components/AppointmentsList.vue'
import CustomerChat from './components/CustomerChat.vue'
import Outreach from './components/Outreach.vue'
import PreviewLanding from './components/PreviewLanding.vue'

/* Admin Views */
import MasterClientList from './components/MasterClientList.vue'
import AdminDashboard from './components/AdminDashboard.vue'
import EmailLog from './components/EmailLog.vue'
import SMSLog from './components/SMSLog.vue'
import IntegrationPortal from './components/IntegrationPortal.vue'
import AccountList from './components/AccountList.vue'
import ParsingList from './components/ParsingList.vue'
import ParsingRules from './components/ParsingRules.vue'
import CreateMailbox from './components/CreateMailbox.vue'
import Mailboxes from './components/Mailboxes.vue'
import MultiReport from './components/Reports/CustomReport.vue'

/* Feedback Views */
import LeaveFeedback from './components/LeaveFeedback.vue'
import LeaveReview from './components/LeaveReview.vue'
import LeaveReviewEmail from './components/LeaveReviewEmail.vue'
import ReviewRedirect from './components/ReviewRedirect.vue'
import SurveyLanding from './components/SurveyLanding.vue'

/* Report Views */
import ReportMasterPlus from './components/Reports/ReportMasterPlus.vue'
import FlowReport from './components/Reports/FlowReport.vue'
import LocationOverview from './components/Reports/LocationOverview.vue'
import CustomReport from './components/Reports/CustomReport.vue'
import TotalUsers from './components/Reports/TotalUsers.vue'

/* Misc. Views */
import ResetPassword from './components/ResetPassword.vue'
import Unsubscribe from './components/Unsubscribe.vue'
import SetPassword from './components/SetPassword.vue'
import ErrorPage from './components/ErrorPage.vue'
import Login from './components/Login.vue'
import ReviewSite from './components/ReviewSite.vue'
// import CampaignList from './components/CampaignList.vue'
import ServerStatus from "./components/ServerStatus.vue";
import Success from "./components/Success.vue";

Vue.use(Router)

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/dashboard',
      name: 'Dashboard',
      component: Dashboard
    },{
      path: '/userList/:state?',
      name: 'User List',
      component: UserList
    },{
      path: '/userProfile',
      name: 'User Profile',
      component: UserProfile
    },{
      path: '/feedback/:word?/:vib?',
      name: 'Feedback',
      component: Feedback
    },{
      path: '/locationList/:location?',
      name: 'Location List',
      component: LocationList
    },{
      path: '/linkLocation',
      name: 'Link Location',
      component: LinkLocation
    },{
      path: '/customerList/:customerId?',
      name: 'Customer List',
      component: Customers
    },{
      path: '/addCustomerMobile',
      name: 'Add Customer',
      component: MobileCustomerAdd
    },{
      path: '/previewLanding',
      name: 'Preview Landing',
      component: PreviewLanding
    },{
    //   path: '/campaigns',
    //   name: 'Campaign List',
    //   component: CampaignList
    // },{
      path: '/automations',
      name: 'Automations',
      component: Automations
    },{
    //   path: '/outreach',
    //   name: 'Outreach',
    //   component: Outreach
    // },{
      path: '/campaigns',
      name: 'Campaigns',
      component: CampaignList
    },{
      path: '/parsingRules/:parser?/:action?',
      name: 'ParseRules',
      component: ParsingRules
    },{
      path: '/parsingList',
      name: 'ParsingList',
      component: ParsingList
    },{
      path: '/reviewRequestsList',
      name: 'Review Requests List',
      component: ReviewRequestList
    },{
      path: '/loyaltyList',
      name: 'Loyalty List',
      component: LoyaltyList
    },{
      path: '/surveyList',
      name: 'Survey List',
      component: SurveyList
    },{
      path: '/appointmentList',
      name: 'Appointments List',
      component: AppointmentsList
    },{
      path: '/masterClientList',
      name: 'Master Client List',
      component: MasterClientList
    },{
      path: '/adminDashboard',
      name: 'Admin Dashboard',
      component: AdminDashboard
    },{
      path: '/accountList',
      name: 'Account List',
      component: AccountList
    },{
      path: '/integrationPortal',
      name: 'Integration Portal',
      component: IntegrationPortal
    },{
      path: '/emailLog',
      name: 'Email Log',
      component: EmailLog
    },{
      path: '/smsLog',
      name: 'SMSLog',
      component: SMSLog
    },{
      path: '/leaveFeedback/:loc/:cid/:src',
      name: 'Leave Feedback',
      component: LeaveFeedback
    },{
      path: '/surveyResponse/:autoid/:action',
      name: 'Answer Survey',
      component: SurveyLanding
    },{
      path: '/leaveReview/:loc/:cid/:rating/:template/:date',
      name: 'Leave Review',
      component: LeaveReview
    },{
      path: '/leaveReviewEmail/:loc/:cid/:rating/:template?',
      name: 'Leave Review Email',
      component: LeaveReviewEmail
    },{
      path: '/automationReviewEmail/:loc/:template/:cid/:rating/:garbage?',
      name: 'Leave Review Email Automation',
      component: LeaveReviewEmail
    },{
      path: '/campaignReviewEmail/:loc/:template/:cid/:rating/:garbage?',
      name: 'Leave Review Email Campaign',
      component: LeaveReviewEmail
    },{
      path: '/reviewRedirect/:loc/:cid/:rIndex?/:date?/:template?',
      name: 'Review Redirect',
      component: ReviewRedirect
      // localhost:8080/reviewRedirect/BS85177170329/BS85177170329/0
    },{
      path: '/customerChat/:locationId/:customerId',
      name: 'Customer Chat',
      component: CustomerChat
    },{
      path: '/reports',
      name: 'Reports',
      component: ReportMasterPlus
    },{
      path: '/reports/flowReport',
      name: 'Flow Report',
      component: FlowReport
    },{
      path: '/reports/locationOverview',
      name: 'Location Overview',
      component: LocationOverview
    },{
      path: '/reports/custom/:id?',
      name: 'Custom Report',
      component: CustomReport
    },{
      path: '/reports/totalUsers',
      name: 'Total Users',
      component: TotalUsers
    },{
      path: '/unsubscribe',
      name: 'Unsubscribe',
      component: Unsubscribe
    },{
      path: '/reviewSite',
      name: 'ReviewSite',
      component: ReviewSite
    },{
      path: '/resetPassword',
      name: 'Reset Password',
      component: ResetPassword
    },{
      path: '/setPassword/:token',
      name: 'Set Password',
      component: SetPassword
    },{
      path: '/errorPage',
      name: 'Error Page',
      component: ErrorPage
    },{
      path: '/login/:reason?',
      name: 'Login',
      component: Login
    },{
      path: '/uploadList/',
      name: 'UploadList',
      component: UploadList
    },{
      path: '/createMailbox',
      name: 'CreateMailbox',
      component: CreateMailbox
    },{
      path: '/mailboxes/:box',
      name: 'mailboxes',
      component: Mailboxes
    },{
      path: '/multiReport',
      name: 'multiReport',
      component: MultiReport
    },{
      path: '/serverUnavailable',
      name: 'serverStatus',
      component: ServerStatus
    },{
      path: '/testSuccess',
      name: 'success',
      component: Success
    },{
      path: '/*',
      redirect: '/login'
    }
  ]
})
